<!DOCTYPE html>
<html lang="en">

<head>
    <title>ORABANK |UTILS</title>
    <meta charset="utf-8" />
    <meta name="csrf-token" content="{{ csrf_token() }}">
    <link rel="shortcut icon" href="assets/media/logos/favicon.ico" />
    <link rel="stylesheet" href="https://fonts.googleapis.com/css?family=Poppins:300,400,500,600,700" />
    <link rel="stylesheet" href="https://cdn.jsdelivr.net/npm/flatpickr/dist/flatpickr.min.css">
    <style>
        /* General body styles */
        body {
            font-family: 'Poppins', sans-serif;
            background-color: #f4f6f9;
            display: flex;
            align-items: center;
            justify-content: center;
            height: 100vh;
            margin: 0;
        }

        .container {
            padding: 2rem;
        }

        /* Card Styles */
        .card {
            max-width: 800px;
            min-height: 500px;
            background-color: #ffffff;
            border-radius: 24px;
            box-shadow: 0 4px 6px rgba(0, 0, 0, 0.1);
            display: flex;
            flex-direction: column;
            justify-content: space-between;
            padding: 2rem;
        }

        /* Text Styles */
        .text-center {
            text-align: center;
        }

        .font-weight-bold {
            font-weight: 700;
        }

        .fs-5 {
            font-size: 1.25rem;
        }

        .mb-2 {
            margin-bottom: 0.5rem;
        }

        /* Button Styles */
        .btn-primary {
            background-color: #007bff;
            border-color: #007bff;
            color: white;
            padding: 0.5rem 1rem;
            font-size: 1rem;
            border-radius: 8px;
            text-decoration: none;
            display: inline-block;
            transition: background-color 0.3s, border-color 0.3s;
        }

        .btn-primary:hover {
            background-color: #0056b3;
            border-color: #0056b3;
        }

        /* Footer Styles */
        .text-muted {
            color: #6c757d;
        }

        .fw-bold {
            font-weight: 700;
        }

        /* Image Styles */
        .img-fluid {
            max-height: 120px;
            width: auto;
        }

        .text-muted p {
            font-size: 0.875rem;
        }

        .btn-success-sm {
            background-color: #28a745;
            /* Couleur de fond verte */
            color: white;
            /* Texte blanc */
            padding: 0.25rem 0.5rem;
            /* Espacement interne */
            font-size: 0.875rem;
            /* Petite taille de texte */
            border-radius: 0.25rem;
            /* Coins légèrement arrondis */
            border: none;
            /* Pas de bordure */
            cursor: pointer;
            /* Curseur en forme de main */
            transition: background-color 0.3s ease;
            /* Effet de transition sur la couleur */
        }

        /* Changement de couleur au survol */
        .btn-success-sm:hover {
            background-color: #218838;
            /* Vert plus foncé au survol */
        }

        a {
            text-decoration: none;
            /* Enlève le soulignement des liens */
        }
    </style>
</head>

<body id="kt_body">
    <div class="container">
        <div class="card mx-auto p-5 shadow-lg w-50 d-flex flex-column justify-content-between">
            <div class="text-center">
                <!-- Logo en base64 -->
                <img alt="Logo"
                    src="data:image/png;base64,"
                    class="img-fluid" style="max-height: 50px;">
            </div>

            <div class="flex-grow-1 d-flex flex-column justify-content-center">
                <!-- Texte de confirmation -->
                <h3 class="font-weight-bold text-center" style="font-size: 1.5rem;">Demande d'habilitation</h3>
                <p class="text-center fs-5" style="font-size: 1rem;">Vous avez reçu une demande d'habilitation.</p>
                <p class="text-center fs-5 mb-2" style="font-size: 1rem;">Veuillez vous connectez pour confirmer votre
                    autorisation.</p>
            </div>

            <!-- Bouton de validation -->
            <div class="text-center">
                <a href="https://obj-app-04/utils/public/login" class="btn-success-sm">Me connecter</a>
            </div>

            <!-- Footer -->
            <div class="text-center mt-4">
                <p class="text-muted mb-0 fs-6">2025© <a href="#" class="text-dark fw-bold">ORABANK | BENIN</a></p>
            </div>
        </div>
    </div>
</body>

</html>